window.bookSummaryJSON = "<p>And the honor of Omega of the Year goes to...knot me.</p> <p>That title goes to my twin sister who is everything a top pack could want.</p> <p>Me? I've never been good at being an omega and have no desire to match with a pack. Especially not the pack of Alphaball players who have their sights set on my sister.</p> <p>When I match with Beck, Rylan, Rio, and Kane, I'm left with little choice but to see the match through.</p> <p>But their pack is in for quite the surprise...I'm knot so perfect and maybe they aren't either.</p> <p><b><i>Knot So Perfect Omega</i></b><b> is a stand-alone and contains adult content. It is a sweet omegaverse told in multiple points of view, where the main character has multiple love interests and doesn't choose.</b></p>"; 
